description:
Sexaholics (Split Scenes)
~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~

Synopsis: It's not about love.Obsession. Addiction. Call it what you will, but when you need it you really need it. Meet June, just your average full-on sex addict. She definitely knows what she wants and how to get it. Trouble is, she's been pressured into a 12 step program to grapple with her issues. Enter the craziest assortment of misfits ever to inhabit one small meeting room! The action is fast and furious, with very little in the way of progress! Come join the group; the donuts are on us!

Cast: A.J. Applegate, Mandy Muse, Shay Fox, Dava Foxx, Mr. Pete, Richie Calhoun, Van Wylde, Ryan Mclane, Alex Jones, Jonathan Morgan,Director

